import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Checkbox, Button, Paper, Box } from '@mui/material';
import { VariableSizeList as List } from 'react-window';
import './TableSelection.css';

const TableSelection = () => {
    const [data, setData] = useState([]);
    const [boldRows, setBoldRows] = useState([]);
    const [checkboxRows, setCheckboxRows] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:3001/activities');
                setData(response.data);
                console.log('Fetched Data:', response.data); // Log the fetched data
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };
        fetchData();
    }, []);

    const handleBoldToggle = (id) => {
        setBoldRows(prev => prev.includes(id) ? prev.filter(i => i !== id) : [...prev, id]);
    };

    const handleCheckboxToggle = (id) => {
        setCheckboxRows(prev => prev.includes(id) ? prev.filter(i => i !== id) : [...prev, id]);
    };

    const handleSubmit = () => {
        navigate('/formatted', { state: { data, boldRows, checkboxRows } });
    };

    const Row = ({ index, style }) => {
        const row = data[index];
        const isBold = boldRows.includes(row.id);
        return (
            <TableRow key={row.id} style={style} className={isBold ? 'bold-row' : ''}>
                <TableCell>{row.hrs}</TableCell>
                <TableCell>{row.mins}</TableCell>
                <TableCell>{row.sec}</TableCell>
                <TableCell>{row['si.no']}</TableCell>
                <TableCell>{row.activity_name}</TableCell>
                <TableCell>{row.confirmed_by}</TableCell>
                <TableCell>
                    <Checkbox 
                        checked={boldRows.includes(row.id)} 
                        onChange={() => handleBoldToggle(row.id)} 
                    />
                </TableCell>
                <TableCell>
                    <Checkbox 
                        checked={checkboxRows.includes(row.id)} 
                        onChange={() => handleCheckboxToggle(row.id)} 
                    />
                </TableCell>
            </TableRow>
        );
    };

    const getItemSize = () => 60; // Fixed height for rows

    return (
        <Box sx={{ padding: 2 }}>
            <TableContainer component={Paper} sx={{ height: 600, width: '100%', marginBottom: 2 }}>
                <Table stickyHeader sx={{ minWidth: 650 }}>
                    <TableHead>
                        <TableRow>
                            <TableCell>Hrs</TableCell>
                            <TableCell>Min</TableCell>
                            <TableCell>Sec</TableCell>
                            <TableCell>Si. No</TableCell>
                            <TableCell>Activity Name</TableCell>
                            <TableCell>Confirmed By</TableCell>
                            <TableCell>Bold</TableCell>
                            <TableCell>Checkbox</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        <List
                            height={540}
                            itemCount={data.length}
                            itemSize={getItemSize}
                            width="100%"
                            outerElementType={React.forwardRef((props, ref) => <div ref={ref} {...props} />)}
                            innerElementType={React.forwardRef(({ style, ...rest }, ref) => (
                                <div ref={ref} style={{ ...style, display: 'block', width: '100%' }} {...rest} />
                            ))}
                        >
                            {({ index, style }) => <Row index={index} style={style} />}
                        </List>
                    </TableBody>
                </Table>
            </TableContainer>
            <Button variant="contained" color="primary" onClick={handleSubmit} style={{ margin: '20px auto', display: 'block' }}>
                Proceed
            </Button>
        </Box>
    );
};

export default TableSelection;
